import { useEffect, useState } from 'react';
import './App.css';
import { Pokemon } from './components/pokemon';
import Axios from "axios";

const [pokemon, setPokemon] = useState([]);

useEffect(() => {
  Axios.get('http://localhost:3001/api/get').then((response) => {
    setPokemon(response.data)
  })
}, [])
function App() {
  return (
    <div>
        <Pokemon pokemonNumber={1} pokemonName='Bulbasaur' shiny= {false} urlImage='https://www.serebii.net/swordshield/pokemon/001.png' shinyUrlImage='https://www.serebii.net/Shiny/SWSH/001.png'></Pokemon>
        {pokemon.map((value) => {
          return <p>{value.po}</p>
        })}
    </div>
  );
}

export default App;
